import React from "react";
import  { PayAccountUser, PaymentHeader, PayOrderProcess, PayyMenthod, PayNote } from "../Components/Payment";
import HomePage from "../Components/HomePage";
import { Route, Router, Routes } from "react-router-dom";


//component success và payment
export default function Pay(){
    return(
        <div>
            <Router>
                <Routes>
                    <Route path="/" element={<HomePage/>}> </Route>
                    <Route path="/paymentheader" element={<PaymentHeader/>}> </Route>
                </Routes>
            </Router>
             <PayAccountUser/>
             <PayOrderProcess/>
             <PayyMenthod/>
             <PayNote/>
        </div>       
    );
}
